import React, { useState, useEffect } from 'react';
import { fetchFilteredData, fetchCategories } from '../services/api';
import LineChart from './Charts/LineChart';
import PieChart from './Charts/PieChart';
import BarChart from './Charts/BarChart';
import Filters from './Filters';
import DataTable from './DataTable';
import { Grid, Paper, Typography } from '@mui/material';

const Dashboard = () => {
  const [data, setData] = useState([]);
  const [graphData, setGraphData] = useState({ pie: [], bar: [], line: [] });
  const [filters, setFilters] = useState({});
  const [categories, setCategories] = useState({});

  const applyFilters = () => {
    fetchFilteredData(filters)
      .then((response) => {
        const mappedData = response.data.map((item) => ({
          ...item,
          paytype_name: categories.paytype_id[item.paytype_id],
          provider_name: categories.provider_id[item.provider_id],
          employee_type_name: categories.employee_type_id[item.employee_type_id],
        }));

        setData(mappedData);

        // Prepare graph data
        const pieData = Object.values(
          mappedData.reduce((acc, item) => {
            acc[item.paytype_name] = acc[item.paytype_name] || { name: item.paytype_name, value: 0 };
            acc[item.paytype_name].value += item.amount;
            return acc;
          }, {})
        );

        const barData = Object.values(
          mappedData.reduce((acc, item) => {
            acc[item.provider_name] = acc[item.provider_name] || { name: item.provider_name, value: 0 };
            acc[item.provider_name].value += item.amount;
            return acc;
          }, {})
        );

        const lineData = mappedData.reduce((acc, item) => {
          const existing = acc.find((entry) => entry.date === item.date);
          if (existing) {
            existing.amount += item.amount;
          } else {
            acc.push({ date: item.date, amount: item.amount });
          }
          return acc;
        }, []);

        setGraphData({ pie: pieData, bar: barData, line: lineData });
      })
      .catch((error) => console.error('Error Fetching Data:', error));
  };

  useEffect(() => {
    fetchCategories().then((response) => {
      setCategories(response.data);
    });
  }, []);

  return (
    <div style={{ padding: '20px', maxWidth: '1200px', margin: 'auto', fontFamily: 'Arial, sans-serif' }}>
      <Typography variant="h4" gutterBottom style={{ color: '#1E88E5', fontWeight: 'bold' }}>
        Dashboard
      </Typography>

      <Filters filters={filters} setFilters={setFilters} onApplyFilters={applyFilters} />

      <DataTable data={data} />

      <Grid container spacing={2} style={{ marginTop: '20px' }}>
        <Grid item xs={12} sm={6}>
          <Paper elevation={3} style={{ padding: '20px', height: '350px' }}>
            <Typography variant="h6" gutterBottom style={{ color: '#1E88E5', fontWeight: '600' }}>
              Pay Type Distribution
            </Typography>
            <PieChart data={graphData.pie} />
          </Paper>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Paper elevation={3} style={{ padding: '20px', height: '350px' }}>
            <Typography variant="h6" gutterBottom style={{ color: '#1E88E5', fontWeight: '600' }}>
              Provider Contributions
            </Typography>
            <BarChart data={graphData.bar} />
          </Paper>
        </Grid>
        <Grid item xs={12}>
          <Paper elevation={3} style={{ padding: '20px', height: '400px' }}>
            <Typography variant="h6" gutterBottom style={{ color: '#1E88E5', fontWeight: '600' }}>
              Trends Over Time
            </Typography>
            <LineChart data={graphData.line} />
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
};

export default Dashboard;
